import React from "react";
import { GoogleMap } from '@react-google-maps/api';

const Map = () => {
    return (
        <div className="map">
            <GoogleMap
                bootstrapURLKeys={{key: 'AIzaSyBXinmo8mKczhwUx5Mb8VhqF1DN44lAobk' }}
                defaultZoom={15}
                defaultCenter={{lat: 37.5, lng: 127}}>
            </GoogleMap>
        </div>
    );
}

export default Map;
